    /**
     * 身份证识别
     * @param imageBase64
     * @param cardSide 正面：FRONT 反面：BACK
     */
    public static String Identification(String imageBase64,String cardSide){
        try{
            Credential cred = new Credential(SECRET_ID, SECRET_KEY);

            HttpProfile httpProfile = new HttpProfile();
            httpProfile.setEndpoint(IDENTIFICATION);

            ClientProfile clientProfile = new ClientProfile();
            clientProfile.setHttpProfile(httpProfile);

            OcrClient client = new OcrClient(cred, REGION, clientProfile);

            IDCardOCRRequest req = new IDCardOCRRequest();
            req.setImageBase64(imageBase64);
            req.setCardSide(cardSide);

            IDCardOCRResponse resp = client.IDCardOCR(req);

            return IDCardOCRResponse.toJsonString(resp);
        } catch (TencentCloudSDKException e) {
            System.out.println(e.toString());
        }
        return null;
    }

    public static String FaceComparison(String imageA, String imageB){
        try{
            Credential cred = new Credential(SECRET_ID, SECRET_KEY);

            HttpProfile httpProfile = new HttpProfile();
            httpProfile.setEndpoint(FACE_COMPARISON);

            ClientProfile clientProfile = new ClientProfile();
            clientProfile.setHttpProfile(httpProfile);

            IaiClient client = new IaiClient(cred, REGION, clientProfile);

            CompareFaceRequest req = new CompareFaceRequest();
            req.setImageA(imageA);
            req.setImageB(imageB);
            CompareFaceResponse resp = client.CompareFace(req);

            return CompareFaceResponse.toJsonString(resp);
        } catch (TencentCloudSDKException e) {
            System.out.println(e.toString());
        }
        return null;
    }

